  }

  String base64String(Uint8List data) {
    return base64Encode(data);
  }

  int _idx = 0;
  String user = 'unison_cota_mariel';
  String password = 'PMaz7E23Dh';
  String img = 'x';
  String name = 'x';
  final _random = Random();
  DateTime fecha = DateTime.now();
  DateTime fecha2 = DateTime.now();
  String? _token;
  String temperatura = "30¬∞ C";

  void _actualiza() async {
    fecha2 = DateTime.now();
    // if (fecha2.isBefore(fecha.add(const Duration(seconds: 7)))) {
    //   return;
    // }

    final tokenRes = await _obtenToken(user, password);

    final Map<String, dynamic> clima = await _obtenMeteomaticData(tokenRes);
    setState(() {
      temperatura =
          "${clima["data"][0]["coordinates"][0]["dates"][0]["value"]}¬∞ C";
      _idx = _random.nextInt(4);
    });
  }

  Future<String> _obtenToken(String username, String password) async {
    const apiURL = 'https://login.meteomatics.com/api/v1/token';
    final response = await http.get(
      Uri.parse(apiURL),
      headers: {
        'Content-Type': 'application/json',
        "Authorization":
            "Basic ${base64Encode("$username:$password".codeUnits)}",
      },
    );
    if (response.statusCode == 200) {
      final tokenJson = jsonDecode(response.body);
      return tokenJson['access_token'];
    } else {
      throw Exception('Falla al obtener token');
    }
  }

  Future<Map<String, dynamic>> _obtenMeteomaticData(String token) async {
    final dateTime = DateTime.now();

    final date = "${dateTime.year}-${dateTime.month}-${dateTime.day}";
    final time =
        "${dateTime.hour}:${dateTime.minute.toString().padLeft(2, "0")}";

    final apiURL =
        'https://api.meteomatics.com/${date}T$time:00.000-07:00/t_2m:C/${ciudad.coordenadas}/json?model=mix&access_token=$token';
    final response = await http.get(
      Uri.parse(apiURL),
      headers: {
        'Content-Type': 'application/json',
        'Authorization': 'Bearer $token',
      },
    );

    if (response.statusCode == 200) {
      return jsonDecode(response.body);
    } else {
      throw Exception('Falla al obtener datos de Meteomatics');
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
