class SettingsPage extends StatefulWidget {
  final String appBarTitle;
  final List<Ciudad> ciudades;
  final int ciudadIndex;
  final void Function(int) onCiudadChanged;

  const SettingsPage({
    Key? key,
    required this.appBarTitle,
    required this.ciudades,
    required this.ciudadIndex,
    required this.onCiudadChanged,
  }) : super(key: key);

  @override
  _SettingsPageState createState() => _SettingsPageState();
}

class _SettingsPageState extends State<SettingsPage> {
  List<Ciudad> get ciudades => widget.ciudades;
  int get ciudadIndex => widget.ciudadIndex;
  void Function(int) get onCiudadChanged => widget.onCiudadChanged;

  @override
  Widget build(BuildContext context) {
    return Column(
      mainAxisAlignment: MainAxisAlignment.center,
      children: [
        const Text('Selecciona la ciudad:'),
        const SizedBox(height: 16),
        Expanded(
          child: ListView.builder(
            shrinkWrap: true,
            itemCount: ciudades.length,
            itemBuilder: (ctx, index) {
              return ListTile(
                title: Text(
                  ciudades[index].city,
                  style: TextStyle(
                    color: index == ciudadIndex ? Colors.blue : Colors.black,
                    fontWeight: index == ciudadIndex
                        ? FontWeight.bold
                        : FontWeight.normal,
                  ),
                ),
                onTap: () => onCiudadChanged(index),
              );
            },
          ),
        )
      ],
    );
  }
}

